    // Adjust the query function mock to resolve with an empty array
    (query as jest.Mock).mockResolvedValueOnce({ rowCount: 0, rows: [] });

    // Execute the function
    await uploadPackage(mockRequest as Request, mockResponse as Response);

    // Assertions
    expect(mockResponse.json).toHaveBeenCalled();
